package localuploader

import (
	"context"
	"testing"
)

var b64 = `data:image/png;base64,`

func TestLocalUploader_UploadBase64(t *testing.T) {
	uploader := NewUploader("/tmp/amusing-x")

	ctx := context.Background()

	fileName, err := uploader.UploadBase64(ctx, b64, "local.png")
	if err != nil {
		t.Fatal(err)
	}

	t.Logf("filename: %s", fileName)
}
